import React from 'react';

/**
 * AdminCustomers allows viewing and managing registered customers.
 * This is a placeholder component; extend it to show customer lists,
 * profiles and segmentation reports when implementing backend support.
 */
function AdminCustomers() {
  return (
    <div>
      <h1 className="text-2xl font-semibold mb-4">Управление клиентами</h1>
      <p className="text-gray-600">Здесь будет доступен список клиентов с возможностью просмотра истории заказов, сегментации по различным критериям и логами общения.</p>
    </div>
  );
}

export default AdminCustomers;
